import React from 'react';
import { Box, Container, Button, Grid, Paper, Typography } from '@mui/material';
import { makeStyles } from '@material-ui/core';

import Hero from '../../Hero/Hero';
import Footer from '../../Footer/Footer';

const useStyles = makeStyles((theme) => ({
  textContent: {
    alignSelf: 'center',
    marginTop: 'px',
    paddingLeft: theme.spacing(5),
    paddingTop: theme.spacing(2),
  },
  buttons: {
    display: 'flex',
  },
  button: {
    padding: theme.spacing(0.5),
    margin: theme.spacing(0.5),
    textAlign: 'center',
    alignSelf: 'center',
  },
  card: {
    backgroundColor: '#999',
    margin: '15px 15px 0px 15px',
  },
}));

const Projects = (props) => {
  const classes = useStyles();

  const heading = 'Projects';
  const caption = 'This is my Projects';
  const image =
    'https://images.pexels.com/photos/372787/pexels-photo-372787.jpeg?cs=srgb&dl=pexels-pixabay-372787.jpg&fm=jpg';
  const btnLeft = 'Education';
  const btnRight = 'Contact';
  return (
    <Box>
      <Hero
        heading={heading}
        caption={caption}
        image={image}
        btnLeft={btnLeft}
        btnRight={btnRight}
      />
      <Container maxWidth="lg">
        <Paper className={classes.card} elevation={3}>
          <Box className={classes.textContent}>
            <h2>Macros Calculator</h2>
            <Grid container xs={12}>
              <Grid item xs={5}>
                <Box>
                  <h3>Summary</h3>
                </Box>
              </Grid>
              <Grid item xs={4}>
                <h3>Technologies</h3>
                <ol>
                  <li>Javascript</li>
                  <li>React</li>
                </ol>
              </Grid>
              <Grid className={classes.buttons} item xs={3}>
                <Box className={classes.button}>
                  <Button variant="contained">View</Button>
                </Box>
                <Box className={classes.button}>
                  <Button variant="contained">GitHub</Button>
                </Box>
              </Grid>
            </Grid>
          </Box>
        </Paper>
      </Container>

      <Footer />
    </Box>
  );
};

export default Projects;
